testObject.methods:
{getItems:function() {
                    return Array.prototype.slice.call(this.object.options, 0);
                },
selectItem:function(index) {
                    var option = this.object.options[index];
                    if (this.object.multiple) TC_NS.Mouse.down(option);
                    (function() {
                        // Retake the option in case the option which get from outer function is released
                        // by the browser (because we are calling callAsync)
                        var option = this.object.options[index];
                        this.object.scrollTop = option.offsetTop - this.object.options[0].offsetTop;
                        if (this.object.multiple) {
                            TC_NS.Mouse.move(option);
                            TC_NS.Mouse.up(option);
                        }
                        (function() {
                            if (this.object.selectedIndex != index) {
                                if (!Element.hasFocus(this.object)) this.object.focus();
                                this.object.selectedIndex = index;
                                var evt = this.object.ownerDocument.createEvent("Event");
                                evt.initEvent("change", true, true);
                                TC_NS.Mouse.dispatchEvent(evt, this.object);
                                try {
                                    this.object.blur();
                                } catch (ex) {}
                            }
                            this.endExecute(TC_NS.TestObject.RETCODE_SUCCEEDED);
                        }.callAsync(this));
                    }.callAsync(this));
                }
}

